import React from "react";

export default class ContactoPagina extends React.Component {

    constructor(props) {
        super(props);

            this.state = {
                nombre: "",
                mensaje: ""
            }

        this.submitted = this.submitted.bind(this);
        this.changed = this.changed.bind(this);
        }



    submitted(event) {
        alert("Formulario enviado " + this.state.nombre);
        event.preventDefault();
    }


changed(event) {
    this.setState({
        nombree: event.target.value
    })
}


    render() {
        return(
            <>
             <section class="header-liga">
        <div class="container justify-content-center align-items-center">
            <div class="row justify-content-between">
                <div class="col-lg-3 d-flex flex-row justify-content-center align-items-center">
                    <div class="header-left">
                        <p class="text">PÃ¡gina de Contacto </p>
                    </div>
                </div>
                <div class="col-lg-3 mx-5">
                    <div class="header">
                        <p class="text"> Resolvemos tus dudas </p>
                    </div>
                </div>
            </div>
        </div>
    </section>

            <h2>Pagina de Contacto</h2>          

            <form onSubmit={this.submitted}>
                <div className="form-group">
                <label>Nombre</label>
                <input type="text" class="formcontrol" onChange={this.changed}/>
                </div>
                <div className="form-group my-2">
                <label>Mensaje</label>
                <textarea className="form-control"></textarea>
                </div>
                <button type="submit" className="btn btn-primary mt-2">Enviar</button>
            </form>
            </>

        )
    }
}
